  'scatter-clustering-process':
    "/*\ntitle: Clustering Process\ncategory: scatter\ntitleCN: 聚合过程可视化\ndifficulty: 1\n*/\nvar originalData = [\n  [3.275154, 2.957587],\n  [-3.344465, 2.603513],\n  [0.355083, -3.376585],\n  [1.852435, 3.547351],\n  [-2.078973, 2.552013],\n  [-0.993756, -0.884433],\n  [2.682252, 4.007573],\n  [-3.087776, 2.878713],\n  [-1.565978, -1.256985],\n  [2.441611, 0.444826],\n  [-0.659487, 3.111284],\n  [-0.459601, -2.618005],\n  [2.17768, 2.387793],\n  [-2.920969, 2.917485],\n  [-0.028814, -4.168078],\n  [3.625746, 2.119041],\n  [-3.912363, 1.325108],\n  [-0.551694, -2.814223],\n  [2.855808, 3.483301],\n  [-3.594448, 2.856651],\n  [0.421993, -2.372646],\n  [1.650821, 3.407572],\n  [-2.082902, 3.384412],\n  [-0.718809, -2.492514],\n  [4.513623, 3.841029],\n  [-4.822011, 4.607049],\n  [-0.656297, -1.449872],\n  [1.919901, 4.439368],\n  [-3.287749, 3.918836],\n  [-1.576936, -2.977622],\n  [3.598143, 1.97597],\n  [-3.977329, 4.900932],\n  [-1.79108, -2.184517],\n  [3.914654, 3.559303],\n  [-1.910108, 4.166946],\n  [-1.226597, -3.317889],\n  [1.148946, 3.345138],\n  [-2.113864, 3.548172],\n  [0.845762, -3.589788],\n  [2.629062, 3.535831],\n  [-1.640717, 2.990517],\n  [-1.881012, -2.485405],\n  [4.606999, 3.510312],\n  [-4.366462, 4.023316],\n  [0.765015, -3.00127],\n  [3.121904, 2.173988],\n  [-4.025139, 4.65231],\n  [-0.559558, -3.840539],\n  [4.376754, 4.863579],\n  [-1.874308, 4.032237],\n  [-0.089337, -3.026809],\n  [3.997787, 2.518662],\n  [-3.082978, 2.884822],\n  [0.845235, -3.454465],\n  [1.327224, 3.358778],\n  [-2.889949, 3.596178],\n  [-0.966018, -2.839827],\n  [2.960769, 3.079555],\n  [-3.275518, 1.577068],\n  [0.639276, -3.41284]\n];\nvar DIM_CLUSTER_INDEX = 2;\nvar DATA_DIM_IDX = [0, 1];\nvar CENTER_DIM_IDX = [3, 4];\n// See https://github.com/ecomfe/echarts-stat\nvar step = ecStat.clustering.hierarchicalKMeans(originalData, {\n  clusterCount: 6,\n  outputType: 'single',\n  outputClusterIndexDimension: DIM_CLUSTER_INDEX,\n  outputCentroidDimensions: CENTER_DIM_IDX,\n  stepByStep: true\n});\nvar colorAll = [\n  '#bbb',\n  '#37A2DA',\n  '#e06343',\n  '#37a354',\n  '#b55dba',\n  '#b5bd48',\n  '#8378EA',\n  '#96BFFF'\n];\nvar ANIMATION_DURATION_UPDATE = 1500;\nfunction renderItemPoint(params, api) {\n  var coord = api.coord([api.value(0), api.value(1)]);\n  var clusterIdx = api.value(2);\n  if (clusterIdx == null || isNaN(clusterIdx)) {\n    clusterIdx = 0;\n  }\n  var isNewCluster = clusterIdx === api.value(3);\n  var extra = {\n    transition: []\n  };\n  var contentColor = colorAll[clusterIdx];\n  return {\n    type: 'circle',\n    x: coord[0],\n    y: coord[1],\n    shape: {\n      cx: 0,\n      cy: 0,\n      r: 10\n    },\n    extra: extra,\n    style: {\n      fill: contentColor,\n      stroke: '#333',\n      lineWidth: 1,\n      shadowColor: contentColor,\n      shadowBlur: isNewCluster ? 12 : 0,\n      transition: ['shadowBlur', 'fill']\n    }\n  };\n}\nfunction renderBoundary(params, api) {\n  var xVal = api.value(0);\n  var yVal = api.value(1);\n  var maxDist = api.value(2);\n  var center = api.coord([xVal, yVal]);\n  var size = api.size([maxDist, maxDist]);\n  return {\n    type: 'ellipse',\n    shape: {\n      cx: isNaN(center[0]) ? 0 : center[0],\n      cy: isNaN(center[1]) ? 0 : center[1],\n      rx: isNaN(size[0]) ? 0 : size[0] + 15,\n      ry: isNaN(size[1]) ? 0 : size[1] + 15\n    },\n    extra: {\n      renderProgress: ++targetRenderProgress,\n      enterFrom: {\n        renderProgress: 0\n      },\n      transition: 'renderProgress'\n    },\n    style: {\n      fill: null,\n      stroke: 'rgba(0,0,0,0.2)',\n      lineDash: [4, 4],\n      lineWidth: 4\n    }\n  };\n}\nfunction makeStepOption(option, data, centroids) {\n  var newCluIdx = centroids ? centroids.length - 1 : -1;\n  var maxDist = 0;\n  for (var i = 0; i < data.length; i++) {\n    var line = data[i];\n    if (line[DIM_CLUSTER_INDEX] === newCluIdx) {\n      var dist0 = Math.pow(line[DATA_DIM_IDX[0]] - line[CENTER_DIM_IDX[0]], 2);\n      var dist1 = Math.pow(line[DATA_DIM_IDX[1]] - line[CENTER_DIM_IDX[1]], 2);\n      maxDist = Math.max(maxDist, dist0 + dist1);\n    }\n  }\n  var boundaryData = centroids\n    ? [[centroids[newCluIdx][0], centroids[newCluIdx][1], Math.sqrt(maxDist)]]\n    : [];\n  option.options.push({\n    series: [\n      {\n        type: 'custom',\n        encode: {\n          tooltip: [0, 1]\n        },\n        renderItem: renderItemPoint,\n        data: data\n      },\n      {\n        type: 'custom',\n        renderItem: renderBoundary,\n        animationDuration: 3000,\n        silent: true,\n        data: boundaryData\n      }\n    ]\n  });\n}\nvar targetRenderProgress = 0;\noption = {\n  timeline: {\n    top: 'center',\n    right: 50,\n    height: 300,\n    width: 10,\n    inverse: true,\n    autoPlay: false,\n    playInterval: 2500,\n    symbol: 'none',\n    orient: 'vertical',\n    axisType: 'category',\n    label: {\n      formatter: 'step {value}',\n      position: 10\n    },\n    checkpointStyle: {\n      animationDuration: ANIMATION_DURATION_UPDATE\n    },\n    data: []\n  },\n  baseOption: {\n    animationDurationUpdate: ANIMATION_DURATION_UPDATE,\n    transition: ['shape'],\n    tooltip: {},\n    xAxis: {\n      type: 'value'\n    },\n    yAxis: {\n      type: 'value'\n    },\n    series: [\n      {\n        type: 'scatter'\n      }\n    ]\n  },\n  options: []\n};\nmakeStepOption(option, originalData);\noption.timeline.data.push('0');\nfor (var i = 1, stepResult; !(stepResult = step.next()).isEnd; i++) {\n  makeStepOption(\n    option,\n    echarts.util.clone(stepResult.data),\n    echarts.util.clone(stepResult.centroids)\n  );\n  option.timeline.data.push(i + '');\n}\n",
