  'pictorialBar-dotted':
    "/*\ntitle: Dotted bar\ncategory: pictorialBar\ntitleCN: 虚线柱状图效果\n*/\n// Generate data\nlet category = [];\nlet dottedBase = +new Date();\nlet lineData = [];\nlet barData = [];\nfor (let i = 0; i < 20; i++) {\n  let date = new Date((dottedBase += 3600 * 24 * 1000));\n  category.push(\n    [date.getFullYear(), date.getMonth() + 1, date.getDate()].join('-')\n  );\n  let b = Math.random() * 200;\n  let d = Math.random() * 200;\n  barData.push(b);\n  lineData.push(d + b);\n}\n// option\noption = {\n  backgroundColor: '#0f375f',\n  tooltip: {\n    trigger: 'axis',\n    axisPointer: {\n      type: 'shadow'\n    }\n  },\n  legend: {\n    data: ['line', 'bar'],\n    textStyle: {\n      color: '#ccc'\n    }\n  },\n  xAxis: {\n    data: category,\n    axisLine: {\n      lineStyle: {\n        color: '#ccc'\n      }\n    }\n  },\n  yAxis: {\n    splitLine: { show: false },\n    axisLine: {\n      lineStyle: {\n        color: '#ccc'\n      }\n    }\n  },\n  series: [\n    {\n      name: 'line',\n      type: 'line',\n      smooth: true,\n      showAllSymbol: true,\n      symbol: 'emptyCircle',\n      symbolSize: 15,\n      data: lineData\n    },\n    {\n      name: 'bar',\n      type: 'bar',\n      barWidth: 10,\n      itemStyle: {\n        borderRadius: 5,\n        color: new echarts.graphic.LinearGradient(0, 0, 0, 1, [\n          { offset: 0, color: '#14c8d4' },\n          { offset: 1, color: '#43eec6' }\n        ])\n      },\n      data: barData\n    },\n    {\n      name: 'line',\n      type: 'bar',\n      barGap: '-100%',\n      barWidth: 10,\n      itemStyle: {\n        color: new echarts.graphic.LinearGradient(0, 0, 0, 1, [\n          { offset: 0, color: 'rgba(20,200,212,0.5)' },\n          { offset: 0.2, color: 'rgba(20,200,212,0.2)' },\n          { offset: 1, color: 'rgba(20,200,212,0)' }\n        ])\n      },\n      z: -12,\n      data: lineData\n    },\n    {\n      name: 'dotted',\n      type: 'pictorialBar',\n      symbol: 'rect',\n      itemStyle: {\n        color: '#0f375f'\n      },\n      symbolRepeat: true,\n      symbolSize: [12, 4],\n      symbolMargin: 1,\n      z: -10,\n      data: lineData\n    }\n  ]\n};\n",
  'graph-webkit-dep':
    "/*\ntitle: Graph Webkit Dep\ncategory: graph\ntitleCN: WebKit 模块关系依赖图\nshotWidth: 900\ndifficulty: 8\n*/\nmyChart.showLoading();\nmyChart.showLoading();\n$.get(ROOT_PATH + '/data/asset/data/webkit-dep.json', function (webkitDep) {\n  myChart.hideLoading();\n  option = {\n    legend: {\n      data: ['HTMLElement', 'WebGL', 'SVG', 'CSS', 'Other']\n    },\n    series: [\n      {\n        type: 'graph',\n        layout: 'force',\n        animation: false,\n        label: {\n          position: 'right',\n          formatter: '{b}'\n        },\n        draggable: true,\n        data: webkitDep.nodes.map(function (node, idx) {\n          node.id = idx;\n          return node;\n        }),\n        categories: webkitDep.categories,\n        force: {\n          edgeLength: 5,\n          repulsion: 20,\n          gravity: 0.2\n        },\n        edges: webkitDep.links\n      }\n    ]\n  };\n  myChart.setOption(option);\n});\n",
  'graph-label-overlap':
    "/*\ntitle: Hide Overlapped Label\ncategory: graph\ntitleCN: 关系图自动隐藏重叠标签\ndifficulty: 3\n*/\nmyChart.showLoading();\n$.getJSON(ROOT_PATH + '/data/asset/data/les-miserables.json', function (graph) {\n  myChart.hideLoading();\n  option = {\n    tooltip: {},\n    legend: [\n      {\n        data: graph.categories.map(function (a) {\n          return a.name;\n        })\n      }\n    ],\n    series: [\n      {\n        name: 'Les Miserables',\n        type: 'graph',\n        layout: 'none',\n        data: graph.nodes,\n        links: graph.links,\n        categories: graph.categories,\n        roam: true,\n        label: {\n          show: true,\n          position: 'right',\n          formatter: '{b}'\n        },\n        labelLayout: {\n          hideOverlap: true\n        },\n        scaleLimit: {\n          min: 0.4,\n          max: 2\n        },\n        lineStyle: {\n          color: 'source',\n          curveness: 0.3\n        }\n      }\n    ]\n  };\n  myChart.setOption(option);\n});\n",
