  'gauge-multi-title':
    "/*\ntitle: Multi Title Gauge\ntitleCN: 多标题仪表盘\ncategory: gauge\ndifficulty: 4\n*/\nconst gaugeData = [\n  {\n    value: 20,\n    name: 'Good',\n    title: {\n      offsetCenter: ['-40%', '80%']\n    },\n    detail: {\n      offsetCenter: ['-40%', '95%']\n    }\n  },\n  {\n    value: 40,\n    name: 'Better',\n    title: {\n      offsetCenter: ['0%', '80%']\n    },\n    detail: {\n      offsetCenter: ['0%', '95%']\n    }\n  },\n  {\n    value: 60,\n    name: 'Perfect',\n    title: {\n      offsetCenter: ['40%', '80%']\n    },\n    detail: {\n      offsetCenter: ['40%', '95%']\n    }\n  }\n];\noption = {\n  series: [\n    {\n      type: 'gauge',\n      anchor: {\n        show: true,\n        showAbove: true,\n        size: 18,\n        itemStyle: {\n          color: '#FAC858'\n        }\n      },\n      pointer: {\n        icon: 'path://M2.9,0.7L2.9,0.7c1.4,0,2.6,1.2,2.6,2.6v115c0,1.4-1.2,2.6-2.6,2.6l0,0c-1.4,0-2.6-1.2-2.6-2.6V3.3C0.3,1.9,1.4,0.7,2.9,0.7z',\n        width: 8,\n        length: '80%',\n        offsetCenter: [0, '8%']\n      },\n      progress: {\n        show: true,\n        overlap: true,\n        roundCap: true\n      },\n      axisLine: {\n        roundCap: true\n      },\n      data: gaugeData,\n      title: {\n        fontSize: 14\n      },\n      detail: {\n        width: 40,\n        height: 14,\n        fontSize: 14,\n        color: '#fff',\n        backgroundColor: 'inherit',\n        borderRadius: 3,\n        formatter: '{value}%'\n      }\n    }\n  ]\n};\nsetInterval(function () {\n  gaugeData[0].value = +(Math.random() * 100).toFixed(2);\n  gaugeData[1].value = +(Math.random() * 100).toFixed(2);\n  gaugeData[2].value = +(Math.random() * 100).toFixed(2);\n  myChart.setOption({\n    series: [\n      {\n        data: gaugeData\n      }\n    ]\n  });\n}, 2000);\n",
