  'custom-bar-trend':
    "/*\ntitle: Custom Bar Trend\ncategory: custom\ntitleCN: 使用自定义系列添加柱状图趋势\ndifficulty: 3\n*/\nconst yearCount = 7;\nconst categoryCount = 30;\nconst xAxisData = [];\nconst customData = [];\nconst legendData = [];\nconst dataList = [];\nlegendData.push('trend');\nconst encodeY = [];\nfor (var i = 0; i < yearCount; i++) {\n  legendData.push(2010 + i + '');\n  dataList.push([]);\n  encodeY.push(1 + i);\n}\nfor (var i = 0; i < categoryCount; i++) {\n  var val = Math.random() * 1000;\n  xAxisData.push('category' + i);\n  var customVal = [i];\n  customData.push(customVal);\n  for (var j = 0; j < dataList.length; j++) {\n    var value =\n      j === 0\n        ? echarts.number.round(val, 2)\n        : echarts.number.round(\n            Math.max(0, dataList[j - 1][i] + (Math.random() - 0.5) * 200),\n            2\n          );\n    dataList[j].push(value);\n    customVal.push(value);\n  }\n}\noption = {\n  tooltip: {\n    trigger: 'axis'\n  },\n  legend: {\n    data: legendData\n  },\n  dataZoom: [\n    {\n      type: 'slider',\n      start: 50,\n      end: 70\n    },\n    {\n      type: 'inside',\n      start: 50,\n      end: 70\n    }\n  ],\n  xAxis: {\n    data: xAxisData\n  },\n  yAxis: {},\n  series: [\n    {\n      type: 'custom',\n      name: 'trend',\n      renderItem: function (params, api) {\n        var xValue = api.value(0);\n        var currentSeriesIndices = api.currentSeriesIndices();\n        var barLayout = api.barLayout({\n          barGap: '30%',\n          barCategoryGap: '20%',\n          count: currentSeriesIndices.length - 1\n        });\n        var points = [];\n        for (var i = 0; i < currentSeriesIndices.length; i++) {\n          var seriesIndex = currentSeriesIndices[i];\n          if (seriesIndex !== params.seriesIndex) {\n            var point = api.coord([xValue, api.value(seriesIndex)]);\n            point[0] += barLayout[i - 1].offsetCenter;\n            point[1] -= 20;\n            points.push(point);\n          }\n        }\n        var style = api.style({\n          stroke: api.visual('color'),\n          fill: 'none'\n        });\n        return {\n          type: 'polyline',\n          shape: {\n            points: points\n          },\n          style: style\n        };\n      },\n      itemStyle: {\n        borderWidth: 2\n      },\n      encode: {\n        x: 0,\n        y: encodeY\n      },\n      data: customData,\n      z: 100\n    },\n    ...dataList.map(function (data, index) {\n      return {\n        type: 'bar',\n        animation: false,\n        name: legendData[index + 1],\n        itemStyle: {\n          opacity: 0.5\n        },\n        data: data\n      };\n    })\n  ]\n};\n",
  'bar-histogram':
    "/*\ntitle: Histogram with Custom Series\ncategory: custom\ntitleCN: 直方图（自定义系列）\ndifficulty: 0\n*/\n// See https://github.com/ecomfe/echarts-stat\necharts.registerTransform(ecStat.transform.histogram);\noption = {\n  dataset: [\n    {\n      source: [\n        [8.3, 143],\n        [8.6, 214],\n        [8.8, 251],\n        [10.5, 26],\n        [10.7, 86],\n        [10.8, 93],\n        [11.0, 176],\n        [11.0, 39],\n        [11.1, 221],\n        [11.2, 188],\n        [11.3, 57],\n        [11.4, 91],\n        [11.4, 191],\n        [11.7, 8],\n        [12.0, 196],\n        [12.9, 177],\n        [12.9, 153],\n        [13.3, 201],\n        [13.7, 199],\n        [13.8, 47],\n        [14.0, 81],\n        [14.2, 98],\n        [14.5, 121],\n        [16.0, 37],\n        [16.3, 12],\n        [17.3, 105],\n        [17.5, 168],\n        [17.9, 84],\n        [18.0, 197],\n        [18.0, 155],\n        [20.6, 125]\n      ]\n    },\n    {\n      transform: {\n        type: 'ecStat:histogram',\n        config: {}\n      }\n    },\n    {\n      transform: {\n        type: 'ecStat:histogram',\n        // print: true,\n        config: { dimensions: [1] }\n      }\n    }\n  ],\n  tooltip: {},\n  grid: [\n    {\n      top: '50%',\n      right: '50%'\n    },\n    {\n      bottom: '52%',\n      right: '50%'\n    },\n    {\n      top: '50%',\n      left: '52%'\n    }\n  ],\n  xAxis: [\n    {\n      scale: true,\n      gridIndex: 0\n    },\n    {\n      type: 'category',\n      scale: true,\n      axisTick: { show: false },\n      axisLabel: { show: false },\n      axisLine: { show: false },\n      gridIndex: 1\n    },\n    {\n      scale: true,\n      gridIndex: 2\n    }\n  ],\n  yAxis: [\n    {\n      gridIndex: 0\n    },\n    {\n      gridIndex: 1\n    },\n    {\n      type: 'category',\n      axisTick: { show: false },\n      axisLabel: { show: false },\n      axisLine: { show: false },\n      gridIndex: 2\n    }\n  ],\n  series: [\n    {\n      name: 'origianl scatter',\n      type: 'scatter',\n      xAxisIndex: 0,\n      yAxisIndex: 0,\n      encode: { tooltip: [0, 1] },\n      datasetIndex: 0\n    },\n    {\n      name: 'histogram',\n      type: 'bar',\n      xAxisIndex: 1,\n      yAxisIndex: 1,\n      barWidth: '99.3%',\n      label: {\n        show: true,\n        position: 'top'\n      },\n      encode: { x: 0, y: 1, itemName: 4 },\n      datasetIndex: 1\n    },\n    {\n      name: 'histogram',\n      type: 'bar',\n      xAxisIndex: 2,\n      yAxisIndex: 2,\n      barWidth: '99.3%',\n      label: {\n        show: true,\n        position: 'right'\n      },\n      encode: { x: 1, y: 0, itemName: 4 },\n      datasetIndex: 2\n    }\n  ]\n};\n",
  'multiple-x-axis':
    "/*\ntitle: Multiple X Axes\ncategory: line\ntitleCN: 多 X 轴\ndifficulty: 4\n*/\nconst colors = ['#5470C6', '#EE6666'];\noption = {\n  color: colors,\n  tooltip: {\n    trigger: 'none',\n    axisPointer: {\n      type: 'cross'\n    }\n  },\n  legend: {},\n  grid: {\n    top: 70,\n    bottom: 50\n  },\n  xAxis: [\n    {\n      type: 'category',\n      axisTick: {\n        alignWithLabel: true\n      },\n      axisLine: {\n        onZero: false,\n        lineStyle: {\n          color: colors[1]\n        }\n      },\n      axisPointer: {\n        label: {\n          formatter: function (params) {\n            return (\n              'Precipitation  ' +\n              params.value +\n              (params.seriesData.length ? '：' + params.seriesData[0].data : '')\n            );\n          }\n        }\n      },\n      // prettier-ignore\n      data: ['2016-1', '2016-2', '2016-3', '2016-4', '2016-5', '2016-6', '2016-7', '2016-8', '2016-9', '2016-10', '2016-11', '2016-12']\n    },\n    {\n      type: 'category',\n      axisTick: {\n        alignWithLabel: true\n      },\n      axisLine: {\n        onZero: false,\n        lineStyle: {\n          color: colors[0]\n        }\n      },\n      axisPointer: {\n        label: {\n          formatter: function (params) {\n            return (\n              'Precipitation  ' +\n              params.value +\n              (params.seriesData.length ? '：' + params.seriesData[0].data : '')\n            );\n          }\n        }\n      },\n      // prettier-ignore\n      data: ['2015-1', '2015-2', '2015-3', '2015-4', '2015-5', '2015-6', '2015-7', '2015-8', '2015-9', '2015-10', '2015-11', '2015-12']\n    }\n  ],\n  yAxis: [\n    {\n      type: 'value'\n    }\n  ],\n  series: [\n    {\n      name: 'Precipitation(2015)',\n      type: 'line',\n      xAxisIndex: 1,\n      smooth: true,\n      emphasis: {\n        focus: 'series'\n      },\n      data: [\n        2.6, 5.9, 9.0, 26.4, 28.7, 70.7, 175.6, 182.2, 48.7, 18.8, 6.0, 2.3\n      ]\n    },\n    {\n      name: 'Precipitation(2016)',\n      type: 'line',\n      smooth: true,\n      emphasis: {\n        focus: 'series'\n      },\n      data: [\n        3.9, 5.9, 11.1, 18.7, 48.3, 69.2, 231.6, 46.6, 55.4, 18.4, 10.3, 0.7\n      ]\n    }\n  ]\n};\n",
