  'boxplot-light-velocity':
    "/*\ntitle: Boxplot Light Velocity\ncategory: boxplot\ntitleCN: 基础盒须图\n*/\noption = {\n  title: [\n    {\n      text: 'Michelson-Morley Experiment',\n      left: 'center'\n    },\n    {\n      text: 'upper: Q3 + 1.5 * IQR \\nlower: Q1 - 1.5 * IQR',\n      borderColor: '#999',\n      borderWidth: 1,\n      textStyle: {\n        fontWeight: 'normal',\n        fontSize: 14,\n        lineHeight: 20\n      },\n      left: '10%',\n      top: '90%'\n    }\n  ],\n  dataset: [\n    {\n      // prettier-ignore\n      source: [\n                [850, 740, 900, 1070, 930, 850, 950, 980, 980, 880, 1000, 980, 930, 650, 760, 810, 1000, 1000, 960, 960],\n                [960, 940, 960, 940, 880, 800, 850, 880, 900, 840, 830, 790, 810, 880, 880, 830, 800, 790, 760, 800],\n                [880, 880, 880, 860, 720, 720, 620, 860, 970, 950, 880, 910, 850, 870, 840, 840, 850, 840, 840, 840],\n                [890, 810, 810, 820, 800, 770, 760, 740, 750, 760, 910, 920, 890, 860, 880, 720, 840, 850, 850, 780],\n                [890, 840, 780, 810, 760, 810, 790, 810, 820, 850, 870, 870, 810, 740, 810, 940, 950, 800, 810, 870]\n            ]\n    },\n    {\n      transform: {\n        type: 'boxplot',\n        config: { itemNameFormatter: 'expr {value}' }\n      }\n    },\n    {\n      fromDatasetIndex: 1,\n      fromTransformResult: 1\n    }\n  ],\n  tooltip: {\n    trigger: 'item',\n    axisPointer: {\n      type: 'shadow'\n    }\n  },\n  grid: {\n    left: '10%',\n    right: '10%',\n    bottom: '15%'\n  },\n  xAxis: {\n    type: 'category',\n    boundaryGap: true,\n    nameGap: 30,\n    splitArea: {\n      show: false\n    },\n    splitLine: {\n      show: false\n    }\n  },\n  yAxis: {\n    type: 'value',\n    name: 'km/s minus 299,000',\n    splitArea: {\n      show: true\n    }\n  },\n  series: [\n    {\n      name: 'boxplot',\n      type: 'boxplot',\n      datasetIndex: 1\n    },\n    {\n      name: 'outlier',\n      type: 'scatter',\n      datasetIndex: 2\n    }\n  ]\n};\n",
  'custom-error-bar':
    "/*\ntitle: Error Bar on Catesian\ncategory: custom\ntitleCN: 使用自定系列给柱状图添加误差范围\ndifficulty: 3\n*/\nvar categoryData = [];\nvar errorData = [];\nvar barData = [];\nvar dataCount = 100;\nfor (var i = 0; i < dataCount; i++) {\n  var val = Math.random() * 1000;\n  categoryData.push('category' + i);\n  errorData.push([\n    i,\n    echarts.number.round(Math.max(0, val - Math.random() * 100)),\n    echarts.number.round(val + Math.random() * 80)\n  ]);\n  barData.push(echarts.number.round(val, 2));\n}\noption = {\n  tooltip: {\n    trigger: 'axis',\n    axisPointer: {\n      type: 'shadow'\n    }\n  },\n  title: {\n    text: 'Error bar chart'\n  },\n  legend: {\n    data: ['bar', 'error']\n  },\n  dataZoom: [\n    {\n      type: 'slider',\n      start: 50,\n      end: 70\n    },\n    {\n      type: 'inside',\n      start: 50,\n      end: 70\n    }\n  ],\n  xAxis: {\n    data: categoryData\n  },\n  yAxis: {},\n  series: [\n    {\n      type: 'bar',\n      name: 'bar',\n      data: barData,\n      itemStyle: {\n        color: '#77bef7'\n      }\n    },\n    {\n      type: 'custom',\n      name: 'error',\n      itemStyle: {\n        borderWidth: 1.5\n      },\n      renderItem: function (params, api) {\n        var xValue = api.value(0);\n        var highPoint = api.coord([xValue, api.value(1)]);\n        var lowPoint = api.coord([xValue, api.value(2)]);\n        var halfWidth = api.size([1, 0])[0] * 0.1;\n        var style = api.style({\n          stroke: api.visual('color'),\n          fill: undefined\n        });\n        return {\n          type: 'group',\n          children: [\n            {\n              type: 'line',\n              transition: ['shape'],\n              shape: {\n                x1: highPoint[0] - halfWidth,\n                y1: highPoint[1],\n                x2: highPoint[0] + halfWidth,\n                y2: highPoint[1]\n              },\n              style: style\n            },\n            {\n              type: 'line',\n              transition: ['shape'],\n              shape: {\n                x1: highPoint[0],\n                y1: highPoint[1],\n                x2: lowPoint[0],\n                y2: lowPoint[1]\n              },\n              style: style\n            },\n            {\n              type: 'line',\n              transition: ['shape'],\n              shape: {\n                x1: lowPoint[0] - halfWidth,\n                y1: lowPoint[1],\n                x2: lowPoint[0] + halfWidth,\n                y2: lowPoint[1]\n              },\n              style: style\n            }\n          ]\n        };\n      },\n      encode: {\n        x: 0,\n        y: [1, 2]\n      },\n      data: errorData,\n      z: 100\n    }\n  ]\n};\n",
