  'custom-profit':
    "/*\ntitle: Profit\ncategory: custom\ntitleCN: 利润分布直方图\ndifficulty: 1\n*/\nconst colorList = [\n  '#4f81bd',\n  '#c0504d',\n  '#9bbb59',\n  '#604a7b',\n  '#948a54',\n  '#e46c0b'\n];\nconst data = [\n  [10, 16, 3, 'A'],\n  [16, 18, 15, 'B'],\n  [18, 26, 12, 'C'],\n  [26, 32, 22, 'D'],\n  [32, 56, 7, 'E'],\n  [56, 62, 17, 'F']\n].map(function (item, index) {\n  return {\n    value: item,\n    itemStyle: {\n      color: colorList[index]\n    }\n  };\n});\noption = {\n  title: {\n    text: 'Profit',\n    left: 'center'\n  },\n  tooltip: {},\n  xAxis: {\n    scale: true\n  },\n  yAxis: {},\n  series: [\n    {\n      type: 'custom',\n      renderItem: function (params, api) {\n        var yValue = api.value(2);\n        var start = api.coord([api.value(0), yValue]);\n        var size = api.size([api.value(1) - api.value(0), yValue]);\n        var style = api.style();\n        return {\n          type: 'rect',\n          shape: {\n            x: start[0],\n            y: start[1],\n            width: size[0],\n            height: size[1]\n          },\n          style: style\n        };\n      },\n      label: {\n        show: true,\n        position: 'top'\n      },\n      dimensions: ['from', 'to', 'profit'],\n      encode: {\n        x: [0, 1],\n        y: 2,\n        tooltip: [0, 1, 2],\n        itemName: 3\n      },\n      data: data\n    }\n  ]\n};\n",
  'graph-grid':
    "/*\ntitle: Graph on Cartesian\ncategory: graph\ntitleCN: 笛卡尔坐标系上的 Graph\ndifficulty: 2\n*/\nconst axisData = ['Mon', 'Tue', 'Wed', 'Very Loooong Thu', 'Fri', 'Sat', 'Sun'];\nconst data = axisData.map(function (item, i) {\n  return Math.round(Math.random() * 1000 * (i + 1));\n});\nconst links = data.map(function (item, i) {\n  return {\n    source: i,\n    target: i + 1\n  };\n});\nlinks.pop();\noption = {\n  title: {\n    text: 'Graph on Cartesian'\n  },\n  tooltip: {},\n  xAxis: {\n    type: 'category',\n    boundaryGap: false,\n    data: axisData\n  },\n  yAxis: {\n    type: 'value'\n  },\n  series: [\n    {\n      type: 'graph',\n      layout: 'none',\n      coordinateSystem: 'cartesian2d',\n      symbolSize: 40,\n      label: {\n        show: true\n      },\n      edgeSymbol: ['circle', 'arrow'],\n      edgeSymbolSize: [4, 10],\n      data: data,\n      links: links,\n      lineStyle: {\n        color: '#2f4554'\n      }\n    }\n  ]\n};\n",
  'lines-ny':
    "/*\ntitle: Use lines to draw 1 million ny streets.\ntitleCN: 使用线图绘制近 100 万的纽约街道数据\ncategory: 'map, lines'\nshotDelay: 1000\n*/\nvar CHUNK_COUNT = 32;\nvar dataCount = 0;\nfunction fetchData(idx) {\n  if (idx >= CHUNK_COUNT) {\n    return;\n  }\n  var dataURL =\n    ROOT_PATH + '/data/asset/data/links-ny/links_ny_' + idx + '.bin';\n  var xhr = new XMLHttpRequest();\n  xhr.open('GET', dataURL, true);\n  xhr.responseType = 'arraybuffer';\n  xhr.onload = function (e) {\n    var rawData = new Float32Array(this.response);\n    var data = new Float64Array(rawData.length - 2);\n    var offsetX = rawData[0];\n    var offsetY = rawData[1];\n    var off = 0;\n    var addedDataCount = 0;\n    for (var i = 2; i < rawData.length; ) {\n      var count = rawData[i++];\n      data[off++] = count;\n      for (var k = 0; k < count; k++) {\n        var x = rawData[i++] + offsetX;\n        var y = rawData[i++] + offsetY;\n        data[off++] = x;\n        data[off++] = y;\n        addedDataCount++;\n      }\n    }\n    myChart.appendData({\n      seriesIndex: 0,\n      data: data\n    });\n    dataCount += addedDataCount;\n    fetchData(idx + 1);\n  };\n  xhr.send();\n}\noption = {\n  progressive: 20000,\n  backgroundColor: '#111',\n  geo: {\n    center: [-74.04327099998152, 40.86737600240287],\n    zoom: 360,\n    map: 'world',\n    roam: true,\n    silent: true,\n    itemStyle: {\n      color: 'transparent',\n      borderColor: 'rgba(255,255,255,0.1)',\n      borderWidth: 1\n    }\n  },\n  series: [\n    {\n      type: 'lines',\n      coordinateSystem: 'geo',\n      blendMode: 'lighter',\n      dimensions: ['value'],\n      data: new Float64Array(),\n      polyline: true,\n      large: true,\n      lineStyle: {\n        color: 'orange',\n        width: 0.5,\n        opacity: 0.3\n      }\n    }\n  ]\n};\nfetchData(0);\n",
  'tree-radial':
    "/*\ntitle: Radial Tree\ncategory: tree\ntitleCN: 径向树状图\n*/\nmyChart.showLoading();\n$.get(ROOT_PATH + '/data/asset/data/flare.json', function (data) {\n  myChart.hideLoading();\n  myChart.setOption(\n    (option = {\n      tooltip: {\n        trigger: 'item',\n        triggerOn: 'mousemove'\n      },\n      series: [\n        {\n          type: 'tree',\n          data: [data],\n          top: '18%',\n          bottom: '14%',\n          layout: 'radial',\n          symbol: 'emptyCircle',\n          symbolSize: 7,\n          initialTreeDepth: 3,\n          animationDurationUpdate: 750,\n          emphasis: {\n            focus: 'descendant'\n          }\n        }\n      ]\n    })\n  );\n});\n",
